script: |
  super -f tsv -I q1.sql | sort > q1.out

vector: true

inputs:
  - name: q1.sql
    data: |
      SELECT DISTINCT + + SUM ( + + CAST ( col2 AS INTEGER ) ) + + COUNT ( ALL - col0 ) AS col0 FROM tab1 cor0 WHERE - 63 NOT BETWEEN col0 * ( col1 ) AND + + CAST ( NULL AS INTEGER );
  - name: tab1

outputs:
  - name: q1.out
    data: |
      226
